import React from 'react';
import { Button, Form, Input } from 'antd';
import Lol_Write from '../pages/lol_write';

const LolWriteFrom = () => {
    return (
        <>
            <Form>
                <Input placeholder={'제목'}></Input>
                <Input.TextArea style={{height: '200px'}}></Input.TextArea>
            </Form>
        </>

    )
};



export default LolWriteFrom;
